    /**
    * @dev create a new loan with eth as collateraland set the address in the mapping
    * @param _pairId number of the pair interested in the loan contract
    * @param _borrowedAskAmount amount in stable coin the borrower would like to receive
    * @param _rpbRate RPB rate the borrower will pay 
    * @return address of the new contract
    */
    function createNewEthLoan(uint _pairId, uint _borrowedAskAmount, uint _rpbRate) external payable nonReentrant returns (address) {
        // in wei
        uint minCollateralEth = calcMinCollateralWithFeesAmount(_pairId, _borrowedAskAmount);
        require(msg.value >= minCollateralEth, "Please send more ethers");
        address _quoteAddress = pairs[_pairId].quoteAddress;
        address newEthLoan = ethDeplContract.deployNewEthLoanContract{value: msg.value}
                    (msg.sender, loanID, _pairId, _borrowedAskAmount, _rpbRate, address(this), _quoteAddress);
        deployedLoans[loanID] = newEthLoan;
        emit NewEthLoanCreated(loanID, msg.sender, newEthLoan, msg.value, minCollateralEth, address(0));
        loanID = loanID.add(1);
        contractCounter = contractCounter.add(1);
        return newEthLoan;
    }

    /**
    * @dev create a new loan and set the address in the mapping
    * @param _pairId number of the pair interested in the loan contract
    * @param _borrowedAskAmount amount in stable coin the borrower would like to receive
    * @param _rpbRate RPB rate the borrower will pay 
    * @return address of the new contract
    */
    function createNewTokenLoan(uint _pairId, uint _borrowedAskAmount, uint _rpbRate) external nonReentrant returns (address) {
        uint totalCollateralTokens = calcMinCollateralWithFeesAmount(_pairId, _borrowedAskAmount);
        uint256 allowance = IERC20(pairs[_pairId].baseAddress).allowance(msg.sender, generalParams.tokenDeployerAddress);  //check the allowance on the deployer
        require(allowance >= totalCollateralTokens, "Check the token allowance");
        address _baseAddress = pairs[_pairId].baseAddress;
        address _quoteAddress = pairs[_pairId].quoteAddress;
        address newTokenLoan = tokenDeplContract.deployNewTokenLoanContract(msg.sender, loanID, _pairId, _borrowedAskAmount, _rpbRate, 
                    address(this), _baseAddress, _quoteAddress, totalCollateralTokens);
        deployedLoans[loanID] = newTokenLoan;
        emit NewTokenLoanCreated(loanID, msg.sender, newTokenLoan, _baseAddress);
        loanID = loanID.add(1);
        contractCounter = contractCounter.add(1);
        return newTokenLoan;
    }


    /**
    * @dev get all deployers addresses
    * @return addresses of the deployer
    */
    function getEnvironmentDeployers() external view returns(address, address) {
        return (address(ethDeplContract), address(tokenDeplContract));
    }

    /**
    * @dev get a single loan address deployed by the factory
    * @return loan contract address
    */
    function getDeployedLoan(uint _idx) external view returns (address) {
        return deployedLoans[_idx];
    }

    /**
    * @dev get the collateral ratio of the loan (subtracting the accrued interests)
    * @param _pairId loan pair Id
    * @param _loanAddress loan address
    * @param _loanStatus loan status
    * @param _borrowedAskAmount loan borrowed ask amount in stable coins
    * @param _accruedInterests loan accrued interests
    * @return newCollRatio collateral ratio
    */
    function getActualCollateralRatio(uint _pairId, address _loanAddress,
                    uint _loanStatus, uint _borrowedAskAmount, uint _accruedInterests) external view returns (uint newCollRatio) {
        uint newPrice = getPairValue(_pairId);
        uint pairDecimals = getPairDecimals(_pairId);
        address collAddress = getPairBaseAddress(_pairId);
        uint8 collDecimals = getPairBaseDecimals(_pairId);
        uint8 lendDecimals = getPairQuoteDecimals(_pairId);
        uint borrAmnt = _borrowedAskAmount;
        uint loanBalance;
        if (collAddress == address(0)) {
            if (_loanStatus == 0)
                loanBalance = _loanAddress.balance;
            else
                loanBalance = (_loanAddress.balance).sub(_accruedInterests);
        } else {
            address tokenLoanAddress = _loanAddress;
            if (_loanStatus == 0)
                loanBalance = IERC20(collAddress).balanceOf(tokenLoanAddress);
            else
                loanBalance = (IERC20(collAddress).balanceOf(tokenLoanAddress)).sub(_accruedInterests); 
        }
        uint numerator = loanBalance.mul(newPrice).mul(100);
        uint quotient = borrAmnt.mul(10 ** pairDecimals);
        if (collDecimals >= lendDecimals) {
            uint diffBaseQuoteDecimals = uint(collDecimals).sub(uint(lendDecimals));
            newCollRatio = numerator.div(quotient).div(10 ** diffBaseQuoteDecimals);
        } else {
            uint diffBaseQuoteDecimals = uint(lendDecimals).sub(uint(collDecimals));
            newCollRatio = numerator.mul(10 ** diffBaseQuoteDecimals).div(quotient);
        }
        return newCollRatio;
    }

    /**
    * @dev calc a new ratio if collateral amount has added to contract balance
    * @param _amount collateral amount to add
    * @return ratio new collateral ratio, percentage with no decimals
    */
    function calcRatioAddingCollateral(uint _amount, uint _pairId, address _loanAddress, uint _borrowedAskAmount) external view returns (uint ratio) {
        uint actualPrice = getPairValue(_pairId);
        uint pairDecimals = getPairDecimals(_pairId);
        address collAddress = getPairBaseAddress(_pairId);
        uint8 collDecimals = getPairBaseDecimals(_pairId);
        uint8 lendDecimals = getPairQuoteDecimals(_pairId);
        uint borrAmnt = _borrowedAskAmount;
        uint loanBalance;
        uint newLoanBal;
        if (collAddress == address(0)) {
            loanBalance = _loanAddress.balance;
            newLoanBal = loanBalance.add(_amount);
        } else {
            loanBalance = IERC20(collAddress).balanceOf(_loanAddress);
            newLoanBal = loanBalance.add(_amount);
        }
        uint numerator = newLoanBal.mul(actualPrice).mul(100);
        uint quotient = borrAmnt.mul(10 ** pairDecimals);
        if (collDecimals >= lendDecimals) {
            uint diffBaseQuoteDecimals = uint(collDecimals).sub(uint(lendDecimals));
            ratio = numerator.div(quotient).div(10 ** diffBaseQuoteDecimals);
        } else {
            uint diffBaseQuoteDecimals = uint(lendDecimals).sub(uint(collDecimals));
            ratio = numerator.mul(10 ** diffBaseQuoteDecimals).div(quotient);
        }
        return ratio;
    }

    /**
    * @dev calc how much collateral amount has to be added to have a ratio
    * @param _ratio ratio to reach, percentage with no decimals (180 means 180%)
    * @param _pairId loan pair Id
    * @param _loanAddress loan address
    * @param _borrowedAskAmount loan borrowed ask amount in stable coins
    * @return collDiff collateral amount to add or to subtract to reach that ratio
    */
    function calcDiffCollAmountForRatio(uint _ratio, uint _pairId, address _loanAddress, uint _borrowedAskAmount) external view returns (uint collDiff) {
        uint actualPrice = getPairValue(_pairId);
        uint pairDecimals = getPairDecimals(_pairId);
        address collAddress = getPairBaseAddress(_pairId);
        uint8 collDecimals = getPairBaseDecimals(_pairId);
        uint8 lendDecimals = getPairQuoteDecimals(_pairId);
        uint borrAmnt = _borrowedAskAmount;
        uint loanBalance;
        if (collAddress == address(0)) 
            loanBalance = _loanAddress.balance;
        else
            loanBalance = IERC20(collAddress).balanceOf(_loanAddress);
        uint newBal;
        uint newRatio = _ratio;
        uint numerator = borrAmnt.mul(newRatio).mul(10 ** pairDecimals);
        uint quotient = actualPrice.mul(100);
        if (collDecimals >= lendDecimals) {
            uint diffBaseQuoteDecimals = uint(collDecimals).sub(uint(lendDecimals));
            newBal = numerator.mul(10 ** diffBaseQuoteDecimals).div(quotient);
        } else {
            uint diffBaseQuoteDecimals = uint(lendDecimals).sub(uint(collDecimals));
            newBal = numerator.div(quotient).div(10 ** diffBaseQuoteDecimals);
        }
        if (newBal >= loanBalance)
            collDiff = newBal.sub(loanBalance);
        else
            collDiff = loanBalance.sub(newBal);
        return collDiff;
    }

}

